import React, {Component} from 'react';
import CustomerHeader from '../CustomerHeader';
import style from './index.module.css';

class MainFrame extends Component {
    render() {
        return (
            <div className={style.frame}>
                <CustomerHeader />
            </div>
        );
    }
}

export default MainFrame;
